import { NavigationBar } from './styles';

export default function NavBar() {
  function handleChangeList(event) {
    console.log('All focado');
    console.log(event.target);
  }

  return (
    <NavigationBar>
      <button type="button" onFocus={handleChangeList}>All</button>
      <button type="button" onFocus={handleChangeList}>Active</button>
      <button type="button">Completed</button>
    </NavigationBar>
  );
}
